package com.luckyrui.platform.chartroom.client;import java.io.IOException;import java.nio.channels.SocketChannel;import com.luckyrui.platform.chartroom.client.frame.ClientFrame;public class ChartRoomClient extends NioClient{		ClientFrame cf;		@Override	protected void serverClose(SocketChannel client) throws IOException {			}	@Override	protected void receiveMsg(SocketChannel client, String receiveMsg)			throws IOException {		System.out.println("receiveMsg -->"+receiveMsg);		cf.receiveMsg(receiveMsg);	}		public void setClientFrame(ClientFrame cf){		this.cf = cf;	}}